import styles from "./LoginPage.module.css";


const LoginPage = () => {

  const handleSubmit = async (e) => {};

  return (
    <div className={styles.loginPage}>
      <div className={styles.signUpWidgetDiv}>
        <img
          className={styles.companyLogoIcon}
          alt=""
          src="../companylogo@2x.png"
        />
        <b className={styles.signUpB}>Sign Up</b>
        <div className={styles.usernameBoxDiv}>
        <span className={styles.usernameSpan}>Username:</span>
          <input className={styles.usernameFieldInput} type="text" />
        </div>
        <div className={styles.passwordBoxDiv}>
          <span className={styles.usernameSpan}>Password:</span>
          <input className={styles.usernameFieldInput} type="text" />
        </div>
        <button className={styles.signUpButton} >
          <div className={styles.signUpTextDiv} onClick={handleSubmit}>Sign up</div>
        </button>
        <span className={styles.redirectSpan} onClick={switchScreen}>
          Already a member? Login here
        </span>
      </div>
    </div>
  );
};

export default LoginPage;
